import React, { Component } from 'react'
import './App.css';

export class ListOfPeople extends Component {
    constructor(props){
        super(props)
        this.state = {
            personData : this.props.list
        }
        this.onDelete = this.onDelete.bind(this);
    }

    onDelete(){
        console.log('click');
    }
    

    
    render() {
        const userInfo = this.state.personData
        
        return (
            <div>
                {
                    userInfo.array.foreach((user) => 
                        <div key = {user._id}>
                            <p>{user.name}</p>
                            <p>{user.email}</p>
                            <button onClick= {this.onDelete}>x</button>
                        </div>
                    )
                }
                
            </div>
        )
    }
}

export default ListOfPeople
